var tipuesearch = {"pages": [{'title': 'About', 'text': '團員:41023125 41023128 \n 倉儲: https://github.com/mdecd2023/2a-pj1ag4/ \n 網站: https://mdecd2023.github.io/2a-pj1ag4/ \n', 'tags': '', 'url': 'About.html'}, {'title': 'w3', 'text': 'w3 - 2023.03.10.16 已經完成分組網頁者, 可以得到分組網頁評分 \n w3 - 請各組寫一個程式判定 2a 哪一組已經完成網頁建置. \n w3 開始執行 \xa0 https://mde.tw/pjcopsim/content/bubbleRobTutorial.html \n 星期四補課時間, 要驗收 Tutorial1 (心得, 展示頁面說明各組員所完成項目, 說明該組的專案規劃) \n \n \n \n \xa0 \n 編寫檢查網頁建置程式 : cmsimde_site (mdecd2023.github.io) \n', 'tags': '', 'url': 'w3.html'}, {'title': 'Tutorial1', 'text': '\n \n \n \n bubbleRob本體 \n slider \n wheels \n \n 心得: \n \xa041023125: \n \xa0一開始編 寫一個程式判定 2a 哪一組已經完成網頁建置的作業中 \n \xa0最初始使用python中的 requests與 lxml模組編寫出\xa0 checkpy.txt \n \xa0之後將其導入Brython發現出現錯誤ModuleNotFoundError: requests \n \xa0發現 brython 中沒有  requests  模組 \n \xa0之後多次嘗試後參考 https://mdecd2023.github.io/2a-pj1agx/content/2apj1.html \xa0 \n \xa0提取出來網站網址與倉儲網址且檢查網站是否建立完成且只列出字串 \n \xa0做出 check.txt \xa0並將每段程式添加了註解\xa0 \n \xa0製作BubbleRob tutorial學到了 感測器的組裝 \n \xa0當特定事件發生時 CoppeliaSim 會呼叫相對應的 callback function 來執行特定的操作 \n \n', 'tags': '', 'url': 'Tutorial1.html'}, {'title': 'notes', 'text': '', 'tags': '', 'url': 'notes.html'}, {'title': 'check', 'text': ' 導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  Filename:  .py    存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n \n', 'tags': '', 'url': 'check.html'}]};